import * as React from 'react';
import "../styles/style.css"

class Imagem extends React.PureComponent{

  render() {
    return(
      <div className={"image"}>
      <img className={'adImg'} src={'../img/indice.jpg'} alt="Minha Figura"/>

        Imagem da internet
      </div>
    )
  }
}

export default Imagem;
